import { useState } from 'react';


import Card from '@mui/material/Card';
import CardHeader from '@mui/material/CardHeader';
import CardContent from '@mui/material/CardContent';
import CardActions from '@mui/material/CardActions';
import Avatar from '@mui/material/Avatar';
import { red } from '@mui/material/colors';
import Button from '@mui/material/Button';

import Box from '@mui/material/Box';
import BottomNavigation from '@mui/material/BottomNavigation';
import BottomNavigationAction from '@mui/material/BottomNavigationAction';
import RestoreIcon from '@mui/icons-material/Restore';
import FavoriteIcon from '@mui/icons-material/Favorite';
import LocationOnIcon from '@mui/icons-material/LocationOn';

const UserProfile = () => {
  const [value, setValue] = useState(0);
  return (
    <Card sx={{ maxWidth: 345 }}>
      <CardHeader
        avatar={
          <Avatar sx={{ bgcolor: red[500] }} aria-label="recipe">
            R
          </Avatar>
        }
        action={
          <Button variant="outlined" style={{ margin: '4px 8px' }}>Log Out</Button>
          // <Button variant="outlined" style={{ margin: '4px 8px' }}>Log Out</Button>
        }
        title="Shrimp Chorizo"
      />
      <CardActions>
      <Box sx={{ width: 500 }}>
      <BottomNavigation
        showLabels
        value={value}
        onChange={(event, newValue) => {
          setValue(newValue);
        }}
      >
        <BottomNavigationAction label="Tweets" icon={<RestoreIcon />} />
        <BottomNavigationAction label="Following" icon={<FavoriteIcon />} />
        <BottomNavigationAction label="Followers" icon={<LocationOnIcon />} />
      </BottomNavigation>
      </Box>
      </CardActions>
    </Card>

  );
}

export default UserProfile;
